import React, { useState } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import Landing from "./pages/Landing";
import Login from "./pages/Login";
import Home from "./pages/Home";
import MMIIVenoso from "./pages/MMIIVenoso";
import EmConstrucao from "./pages/EmConstrucao";
import Configuracoes from "./pages/Configuracoes";
import ExamesRealizados from "./pages/ExamesRealizados";

export default function App() {
  console.log("App component is rendering");
  const [logado, setLogado] = useState(!!localStorage.getItem("userEmail"));

  function login(email) {
    localStorage.setItem("userEmail", email);
    setLogado(true);
  }

  function logout() {
    localStorage.removeItem("userEmail");
    setLogado(false);
  }

  // Teste simples sem React Router
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      padding: 20
    }}>
      <h1 style={{ fontSize: "32px", marginBottom: "20px" }}>VENO.AI</h1>
      <p style={{ fontSize: "18px", textAlign: "center", marginBottom: "30px" }}>
        Gerador de Laudos Doppler Vascular Inteligente
      </p>
      <button 
        style={{
          background: "#0eb8d0",
          color: "#fff",
          border: "none",
          borderRadius: "10px",
          padding: "15px 30px",
          fontSize: "18px",
          cursor: "pointer",
          fontWeight: "600"
        }}
        onClick={() => alert("Aplicação funcionando!")}
      >
        Teste de Funcionamento
      </button>
    </div>
  );
}
